sub _initialize
  {
    my $self = shift;
    my %opts = @_;
    my $h = $HEIGHT; #total image height
    my $w = $WIDTH;
    $self->image_width($w);
    $self->image_height($h);
    $self->bgcolor([255,255,255]) unless $self->bgcolor;
    $self->fill(1);
    $self->order(1);
    $self->stop($self->start + length $self->nt-1) unless $self->stop;
    $self->skip_overlap_search(1); #make sure to skip searching for overlap for these guys.  Search can be slow
    $self->parse_data();
    my $sum = 0;
    my $seq = $self->nt;
    foreach my $pat (@{$self->patterns})
      {
	while ($seq=~ /$pat/ig)
	  {
	    $sum ++;
	  }
      }

    my $p = ($sum*7)/(length ($self->nt));
    my @color;
    my $red = 255;
    $red -= ($p*200);
    $red = 55 if $red < 55;
    my $blue = 255;
    my $green = 255;

    @color = ($blue, $red, $red);

    $self->color(\@color);
    $self->label($self->nt) if $self->nt;
    $self->type('exon_motif');
  }

sub _post_initialize
  {
    my $self = shift;
    my %opts = @_;
    my $gd = $self->gd;
    $gd->fill(0,0, $self->get_color($self->color));
  }

sub parse_data
  {
    my $self = shift;
    my @patterns;
    foreach my $line (split /\n/, $DATA)
      {
	next if $line =~ /^#/;
	my @line = split /\t/, $line;
	$line[1] =~ s/\s+//g if $line[1];
	next unless $line[1];
	next unless $line[15] > $OVERCUT;
	push @patterns, $line[1] if $line[1];
      }
    $self->patterns(\@patterns);
  }
